const Dashboard = () => {
  return (
    <>
      <h1>Dashboard</h1>
      <div class="form-check form-switch">
        <input
          class="form-check-input"
          type="checkbox"
          id="flexSwitchCheckChecked"
          checked
        />
        <label class="form-check-label" for="flexSwitchCheckChecked">
          Checked switch checkbox input
        </label>
      </div>
    </>
  );
};

export default Dashboard;
